// 1.引入React组件
import React ,{Component,Fragment} from 'react';


//2.用class定义组件
class ReactDemo extends Component{

    //组件默认加载数据
    constructor(props){
        super(props);
        this.state={
            list:[],
            inputValue:''
        }
    }


//3.render函数return 模板
    render(){
        return(
            <Fragment>
                <div>
                    <input value={this.state.inputValue} placeholder='TodoList'></input>
                    <ul>
                        <li></li>
                    </ul>
                </div>
            </Fragment>
        );
    }
}

//4.输出
export default ReactDemo;
